import PropTypes from "prop-types"

function Text ({
  label,
  fontSize,
  fontWeight=700,
  color="#222"
}) {

  const style = {
    whiteSpace : 'pre-line',
    fontSize,
    fontWeight,
    color
  }
  return (
    <>
      <div style={style}>{label}</div>
    </>
  )
}

Text.propTypes = {
  fontSize : PropTypes.string,
  fontWeight : PropTypes.string,
  color : PropTypes.string,
}
